const Content = (props) => {
  return (
    <div>
      <Part partNumber={props.part[0]} exercise={props.exercise[0]} />
      <Part part={props.part[1]} exercise={props.exercise[1]} />
      <Part part={props.part[2]} exercise={props.exercise[2]} />
    </div>
  )
}

const Part = (props) => {
  return (
    <div>
      <p> {props.partNumber} {props.exercise}</p>
    </div>
  )

}
const Total = (props) => {
  const total = props.exercise[0] + props.exercise[1] + props.exercise[2]
  return (
    <div>
      <p>Number of exercises {total} </p>
    </div>
  )
}



export default App
